import React, { Component } from 'react';
import './Calculadora.css';
import './Portales.css'
import Boton from './Boton'


class Portales extends Component {

    limpiar() {
        console.log("hola");
    }



    render() {
        return (
            <div id="calculadora">
                <h2 id="calculadora__title">Calculadora</h2>
                <div id="calculadora__form">
                    <div id="form__inputs">
                        <input type="number" id="pos-x" placeholder="Coordenada X"/>
                        <input type="number" id="pos-y" placeholder="Coordenada Y"/>
                    </div>
                    <div id="btn-limpiar">
                        <button  className="btn-calc">Limpiar</button>
                    </div>
                </div>
                <div id="calculadora__btn">
                    <Boton click={this.limpiar } name="Limpiar"></Boton>
                </div>
                <div id="calculadora__res">Resultados</div>
            </div>
        )
    }
}


export default Portales;
